#include <stdio.h>
#include <stdlib.h>
#include <string.h>
#include <assert.h>

#define NUM_DIRECTIONS 16643

static float *val_dir = NULL;

void GetDirection(int idx, float *x, float *y, float *z)
{
	*x = val_dir[idx*3 + 0];
	*y = val_dir[idx*3 + 1];
	*z = val_dir[idx*3 + 2];
}

float *ConvertDirections(int sx,int sy,int sz,unsigned short *data)
{
	float *good, x, y, z;

	good = (float*)malloc(sx*sy*sz*sizeof(float)*3);
	memset(good, 0, sx*sy*sz*sizeof(float)*3);

	for (int i=0;i<sx*sy*sz;i++)
	{
		unsigned short val = data[i];
		GetDirection(val, &x,&y,&z);
		good[ i*3 + 0 ] = x;
		good[ i*3 + 1 ] = y;
		good[ i*3 + 2 ] = z;
	}

	return good;
}


